        private static IProfileClothingItem CloneClothingItem(IProfileClothingItem clothingItem)
        {
            if (clothingItem == null) return null;
            return new IProfileClothingItem(clothingItem.Name, clothingItem.Color1, clothingItem.Color2, clothingItem.Color3);
        }

        public static IProfile Clone(IProfile profile)
        {
            if (profile == null) return null;
            return new IProfile
            {
                Name = profile.Name,
                Gender = profile.Gender,
                Accessory = CloneClothingItem(profile.Accessory),
                ChestOver = CloneClothingItem(profile.ChestOver),
                ChestUnder = CloneClothingItem(profile.ChestUnder),
                Head = CloneClothingItem(profile.Head),
                Waist = CloneClothingItem(profile.Waist),
                Hands = CloneClothingItem(profile.Hands),
                Legs = CloneClothingItem(profile.Legs),
                Skin = CloneClothingItem(profile.Skin),
                Feet = CloneClothingItem(profile.Feet),
            };
        }

